import React from 'react';
import { Homepage, Navbar, About, Portfolio, Skills, Contact } from './components';

function App() {
  return (
    <div 
      className="min-h-screen bg-cover bg-center" 
      style={{ backgroundImage: "url('/Homepage2.jpg')" }}
    >
      <Navbar />
      <Homepage />

      {/* Sections below homepage */}
      <About />
      <Skills />
      <Portfolio />
      <Contact />
    </div>
  );
}

export default App;
